import React from "react";
import {Link} from 'react-router-dom';
import './login.css';
class Login extends React.Component {
    constructor() {
        super();
        this.state = {
            username: '',
            email: '',
            password: ''
        };
        this.changeHandler = this.changeHandler.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    changeHandler(event) {
        this.setState({
            [event.target.name]: event.target.value
        });
    }

    async handleSubmit(event) {
        event.preventDefault();
        try {
            const response = await fetch('http://127.0.0.1:8000/login', {
                method: 'POST',
                body: JSON.stringify(this.state),
                headers: {
                    'Content-type': 'application/json; charset=UTF-8',
                }
            });

            if (response.ok) {
                console.log('User login successfully!');
                this.setState({
                    username: '',
                    email: '',
                    password: ''
                });
                // Redirection vers la page racine
                this.props.history.push('/accueil');
                // Rafraîchir la page après la redirection
                window.location.reload()                
            } else {
                console.error('login failed.');
                this.props.history.push('/');
                window.location.reload()
            }
 
        } catch (error) {
            console.error('An error occurred:', error);
        }
    }

    render() {

        return (
                <section className="h-100 gradient-form" >
                <div className="container py-5 h-100">
                    <div className="row d-flex justify-content-center align-items-center h-100">
                    <div className="col-xl-10">
                        <div className="card rounded-3 text-black">
                        <div className="row g-0">
                            <div className="col-lg-6">
                            <div className="card-body p-md-5 mx-md-4">

                                <div className="text-center">
                                <img src="no_bg.png" style={{width: '185px'}} alt="logo"/>
                                <h4 className="mt-1 ">Solution Factory en Force</h4>
                                </div>

                                <form onSubmit={this.handleSubmit}>
                                <p>Veuillez vous identifier pour accéder à votre Espace RH:</p>
                                
                                <div className="form-outline mb-4">
                                    <input type="text" id="username" className="form-control"
                                    placeholder="Enter votre username" />
                                    <label className="form-label" for="form2Example11">Username:</label>
                                </div>

                                <div className="form-outline mb-4">
                                    <input type="password" id="form2Example22" className="form-control" placeholder="Enter votre mot de passe" />
                                    <label className="form-label" for="form2Example22"  >Mot de passe:</label>
                                </div>

                                <div className="text-center pt-1 mb-5 pb-1">
                                    <input className="nav-link btn btn-primary btn-block fa-lg" type='submit' >Login</input>
                                    <Link className="nav-link btn btn-primary btn-block fa-lg" to="/signup">s'inscrire<span className="sr-only">(current)</span></Link>

                                </div>


                                </form>

                            </div>
                            </div>
                            <div className="col-lg-6 d-flex align-items-center gradient-custom-2">
                            <div className="text-white px-3 py-4 p-md-5 mx-md-4">
                                <h1 className="mb-4">Premier groupe d’assurance en Afrique</h1>
                                <p className="small mb-0"><h4>Sanlam, le plus grand assureur du Maroc et l'un des plus grands assureurs au monde.</h4></p>
                            </div>
                            </div>
                        </div>
                        </div>
                    </div>
                    </div>
                </div>
            </section>              
            

        );
    }
}

export default Login;
